var App=angular.module("App",[]);App.controller("ResumeCtrl",function($scope,$http){$http.get("/resume.json").then(function(res){$scope.resume=res.data})}),App.filter("ageFilter",function(){function calculateAge(birthdate){var birthday=new Date(birthdate),ageDifMs=Date.now()-birthday.getTime(),ageDate=new Date(ageDifMs);return Math.abs(ageDate.getUTCFullYear()-1970)}return function(birthdate){return calculateAge(birthdate)}});